class Demo3b {

  paint(ctx, { width, height }, props) { // eslint-disable-line


    ctx.beginPath();
    ctx.moveTo(285, 105);
    ctx.lineTo(302, 109);
    ctx.lineTo(275, 197);
    ctx.lineTo(269, 195);
    ctx.lineTo(285, 105);
    ctx.fillStyle = '#191418';
    ctx.fill();

    ctx.beginPath();
    ctx.arc(268, 209, 9, 0, Math.PI * 2);
    ctx.fill();
  }
}
registerPaint('demo3b', Demo3b); // eslint-disable-line
